East Sussex County Council (ESCC) is a partner in a programme called Low Carbon Across the South East (LoCASE).  The programme is funded by the European Union’s European Regional Development Framework programme (ERDF) and runs from 1 March 2016 to 1 February 2019.  The project will provide a consistent, accessible business support programme across the South East Local Enterprise Partnership (SELEP) area to help small-to-medium sized businesses (SMEs) to optimise the use of resources and adopt low carbon solutions to improve business resilience, profitability and competitiveness, and at the same time contributing to the protection of the environment. LOCASE will offer 2 large grant programmes: energy efficiency grants for all businesses and grants specifically for low carbon, environmental businesses. 

The LoCASE programme is being delivered by 6 partners: Kent County Council, Essex County Council, Southend-on-Sea Council, Thurrock Council, East Sussex County Council and the University of Brighton.  In East Sussex, ESCC will work closely with the University of Brighton’s Green Growth Platform (GGP) to deliver a programme to support:

            1)   any company wishing to improve their energy efficiency (demand side);
            2)   companies in the environmental and low carbon sectors wishing to grow and innovate    
                  (supply side). 

ESCC is responsible for delivering targets which include:

            1)   120 energy audits;
            2)   120 energy efficiency grants.


The 3 types of deliverables required in this request for quotation are:

           1)   The delivery of energy audits to 120 SMEs in East Sussex;

           2)   Support to 120 SMEs in East Sussex to apply for energy efficiency grants;

           3)   Marketing of the energy audits and grant scheme.

The list of tasks required in each of these areas are itemised in Document No 2 Technical Specification
